import "./App.css";
import Header from "./components/Header";

import { ChakraProvider } from "@chakra-ui/react";
import { extendTheme } from "@chakra-ui/react";

const theme = extendTheme({
  colors: {
    brand: {
      100: "#ABC4FF",
      200: "#A4C6FF",
      300: "#A6C8FF",
      400: "#A8CAFF",
      500: "#AACBFF",
      600: "#AACCFF",
      700: "#AACDFF",
      800: "#AAD0FF",
      900: "#D9F3F0",
    },
  },
});

function App() {
  return (
    <ChakraProvider theme={theme}>
      <div className="App">
        <Header />
      </div>
    </ChakraProvider>
  );
}

export default App;
